import React from 'react';

function Education() {
    const [arr, nextItem] = React.useState([]);

    function MoveArr() {
        const getTextVal = document.querySelector('.company').value;
        nextItem(prev => prev.concat(getTextVal));
        console.log(arr);
    }

    return (
    <div className='education'>
           <h1>Education</h1>
            <label>
                School:
                <input type='text' className='school'></input>
                <button>Edit</button>
            </label>
            <label>
                Title of study:
                <input type='text' className='study'></input>
                <button>Edit</button>
            </label>
            <label>
                Date of study:
                <input type='text' className='study-date'></input>
                <button>Edit</button>
            </label>
    </div>
    )
}

function Practical() {
    const [arr, nextItem] = React.useState([]);

    function MoveArr() {
        const getTextVal = document.querySelector('.company').value;
        nextItem(prev => prev.concat(getTextVal));
        console.log(arr);
    }

    return (
    <div className='practical'>
           <h1>Practical</h1>
            <label>
                Company:
                <input type='text' className='company'></input>
                <button>Edit</button>
            </label>
            <label>
                Position:
                <input type='text' className='position'></input>
                <button>Edit</button>
            </label>
            <label>
                Job tasks:
                <input type='text' className='tasks'></input>
                <button>Edit</button>
            </label>
            <input type='submit' className='submitPractical' onClick={moveArr}></input>
        </div>
    )
}

function General() {
    const [arr, nextItem] = React.useState([]);

    function MoveArr() {
        const getTextVal = document.querySelector('.company').value;
        nextItem(prev => prev.concat(getTextVal));
        console.log(arr);
    }

    return (
        <div className='general'>
           <h1>General</h1>
            <label>
                Name:
                <input type='text' className='name'></input>
                <button>Edit</button>
            </label>
            <label>
                Email:
                <input type='text' className='email'></input>
                <button>Edit</button>
            </label>
            <label>
                Phone:
                <input type='text' className='phone'></input>
                <button>Edit</button>
            </label>
            <Education />
            <Practical />
        </div>
    )
}

export default General;
